Defendant in custody on WRIT.
NO CONTEST plea entered to count 1, false imprisonment.  Convicted.
The State moves to dismiss and read in counts 2 and 3 of 15 CF 621 and the charge in 15 CM 616.  Motion granted.
Sentence Withheld.  Defendant is placed on probation to DOC for two (2) years, consecutive to the prison sentence defendant is presently serving on 13 CF 77, to commence on defendants discharge date after extended supervision ends.
Conditions of probation:
1) Maintain fulltime employment, schooling, work search or combination;
2) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
3) Domestic violence assessment and follow through;
4) Pay court costs;
5) pay supervision fees in an amount to be determined by DOC;
6) no contact with Cathleen Yauch except as approved by the agent or as approved by the Department of Corrections if during his confinement period in prison.
Minutes.
